import React from 'react';
export default class PostForm extends React.Component{
    render(){
        return (
            <React.Fragment>
                <h1>Post Form</h1>
                <div className="postform-wrapper">
                    <form className="postform-form">
                        <input type="text" />
                        <textarea></textarea>
                        <input type="submit" value="Submit" />
                    </form>
                </div>
            </React.Fragment>
        );
    }
}
